package com.example.store_online.data_models;public class AccountInformation {    private String gender;    private String nickname;    private String birthday;    private String rank;    private String coin;    private String avatar;    public AccountInformation() {    }    public AccountInformation(String gender, String nickname, String birthday, String rank, String coin, String avatar) {        this.gender = gender;        this.nickname = nickname;        this.birthday = birthday;        this.rank = rank;        this.coin = coin;        this.avatar = avatar;    }    public String getAvatar() {        return avatar;    }    public void setAvatar(String avatar) {        this.avatar = avatar;    }    public String getRank() {        return rank;    }    public void setRank(String rank) {        this.rank = rank;    }    public String getCoin() {        return coin;    }    public void setCoin(String coin) {        this.coin = coin;    }    public String getGender() {        return gender;    }    public void setGender(String gender) {        this.gender = gender;    }    public String getNickname() {        return nickname;    }    public void setNickname(String nickname) {        this.nickname = nickname;    }    public String getBirthday() {        return birthday;    }    public void setBirthday(String birthday) {        this.birthday = birthday;    }}